value.stringValue:
local
  f = import "functions",
  input = std.extVar("apiData"),

  // Helper function to find a spec, decode it, and extract the version.
  // It prioritizes YAML specs and falls back to JSON
  getVersionFromSpecs(specs) =
    // Find any YAML spec
    local yamlSpecs = std.filter(function(s) s.spec.contents.mimeType == 'application/yaml', specs);
    // Find any JSON spec
    local jsonSpecs = std.filter(function(s) s.spec.contents.mimeType == 'application/json', specs);

    // Prioritize the YAML spec if it exists
    if std.length(yamlSpecs) > 0 then
      local yamlSpec = yamlSpecs[0];
      local decodedContent = std.base64Decode(yamlSpec.spec.contents.contents);
      local parsedSpec = std.parseYaml(decodedContent);
      parsedSpec.info.version

    // If no YAML spec, fall back to the JSON spec
    else if std.length(jsonSpecs) > 0 then
      local jsonSpec = jsonSpecs[0];
      local decodedContent = std.base64Decode(jsonSpec.spec.contents.contents);
      local parsedSpec = std.parseJson(decodedContent);
      parsedSpec.info.version

    // If neither is found, return a default value to avoid errors
    else
      'unknown',

  // Main Transformation
  curatedAPIMetadata = input + {
    // Use a merging patch on apiMetadataList
    apiMetadataList+: {
      // Map over the apiMetadata array to transform each item.
      apiMetadata: std.map(
        function(apiMeta)
          // Handle the case where 'versions' might be missing (for example when an API proxy is undeployed)
          if 'versions' in apiMeta && std.type(apiMeta.versions) == 'array' then
            // If it exists, transform it
            apiMeta + {
              versions: std.map(
                function(versionObj)
                  // For each version, extract the version from its specs
                  local extractedVersion = getVersionFromSpecs(versionObj.specs);
                  // and merge it into the displayName.
                  versionObj + {
                    version+: {
                      displayName: extractedVersion,
                    },
                  },
                apiMeta.versions
              ),
            }
          else
            // If 'versions' is missing, return the object as is.
            apiMeta,
        input.apiMetadataList.apiMetadata
      ),
    },
  };

curatedAPIMetadata

